import React from "react";
import BahasaPage from "../components/dashboard/BahasaPage";
import Sidebar from "../components/layouts/Sidebar";

export default function bahasa() {
  return (
    <>
      <main>
        <div className="container">
          <div className="row">
            <Sidebar active={"active"} />
            <BahasaPage />
          </div>
        </div>
      </main>
    </>
  );
}
